import { createSlice } from "@reduxjs/toolkit";

const categorySlice = createSlice({
  name: "catalogs",
  initialState: {
    entities: null,
    isLoading: true,
  },
});

const { reducer: categoryReducer } = categorySlice;

export default categoryReducer;
